import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Provider from './context/Provider';

function App() {
  return (
    <div className="App">
      <Provider>
        <BrowserRouter>
          <Switch>
            <Route />
          </Switch>
        </BrowserRouter>
      </Provider>
    </div>
  );
}

export default App;
